import { useState, useEffect } from "react";
import { createClient } from "@supabase/supabase-js";
import PhotoCard from "../components/photoCard";
import { Grid } from "@mui/material";

const supabaseUrl = "https://uxcdfactbubyfmlvtyas.supabase.co";
const supabaseKey = process.env.REACT_APP_PROJECT_API_KEY;
const supabase = createClient(supabaseUrl, supabaseKey);

const Photography = () => {
	const [images, setImages] = useState([]);
	const [supabase, setSupabase] = useState(null);

	useEffect(() => {
	  const initializeSupabase = async () => {
		try {
		  const response = await fetch('/api/supabase-config');
		  const { supabaseUrl, supabaseKey } = await response.json();
		  const supabaseClient = createClient(supabaseUrl, supabaseKey);
		  setSupabase(supabaseClient);
		} catch (error) {
		  console.error("Error initializing Supabase:", error);
		}
	  };
  
	  initializeSupabase();
	}, []);

	useEffect(() => {
		const fetchImages = async () => {
			const { data, error } = await supabase.storage
				.from("Photography") 
				.list("public", { limit: 100 });

			if (error) {
				console.error("Error fetching images:", error);
			} else {
				const imageObjects = data.map((file) => ({
					title: file.name.split(".")[0],
					url: supabase.storage.from("Photography").getPublicUrl("public/" + file.name).data.publicUrl,
				}));
				console.log(imageObjects);
				setImages(imageObjects);
			}
		};

		fetchImages();
	}, []);

	return (
		<Grid container spacing={5} className="animate-slide-up">
			{images.map((image, index) => (
				<Grid item xs={12} sm={6} md={5} key={index}>
					<PhotoCard image={image} />
				</Grid>
			))}
		</Grid>
	);
};

export default Photography;
